import React from "react";
import './App.css'

fetch('https://parallelum.com.br/fipe/api/v1/carros/marcas')
.then((response) => console.log(response))
.catch((err) => console.log(err));

function App () {

  const marcasResponse = fetch('https://parallelum.com.br/fipe/api/v1/carros/marcas')
  .then((response) => console.log(response))
.catch((err) => console.log(err));;
  const marcas = marcasResponse.json();
  const modelosResponse = fetch('https://parallelum.com.br/fipe/api/v1/carros/marcas/59/modelos');
  const modelos = modelosResponse.json();
  const anosResponse = fetch('https://parallelum.com.br/fipe/api/v1/carros/marcas/59/modelos/5940/anos');
  const anos = anosResponse.json();
  return ({ marcas, modelos, anos });

};

export default App;
